import "../Sass/_avaliacoes.scss";
import {Container, Row, Col, Form, Button} from 'react-bootstrap';
import React from 'react';
import Pagination from 'react-bootstrap/Pagination';

const Avaliacoes = () => {
    return (
        <>
        <Container className="cont2">
        <Row className="row">
        <Col> 

        <Pagination>
        <Pagination.Prev href="/">Voltar</Pagination.Prev>
    </Pagination>
        <Form>
          <h2>Avaliação</h2>
      
      <h3>O que você escolheu hoje?</h3>
      {['radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-3">
          <Form.Check
            inline
            label="Excelente"
            name="group1"
            type={type}
            id={`inline-${type}-1`}
          />
          <Form.Check
            inline
            label="Bom"
            name="group1"
            type={type}
            id={`inline-${type}-2`}
          />
         
          
        </div>
      ))}

      
       
      
    </Form>
    <Pagination>
      <Pagination.Next href="/avaliacao-carne">Próximo</Pagination.Next>
    </Pagination>
    </Col>
      </Row>
      
    </Container>
    </>
    
    );

}

export default Avaliacoes;
